	public JSONObject getData2(){
		vpservice.extracVisualPoint();
		JSONObject json=vpservice.point2Json();
		Date date=new Date();
		String filename=new SimpleDateFormat("yyyy-MM-dd HH-mm-ss").format(date);
		try {
			BufferedWriter fw=new BufferedWriter(new OutputStreamWriter(new FileOutputStream(new File("G:/SCTS/History/"+filename+".json"),true),"utf-8"));
			fw.write(json.toString());
			fw.flush();
			fw.close();
		} catch (IOException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		} 
        return json;
	}
